`,paraId:7,tocIndex:4},{value:"When ",paraId:8,tocIndex:5},{value:"process is not defined",paraId:8,tocIndex:5},{value:" appears, please check whether the variable exists in the ",paraId:8,tocIndex:5},{value:"root/path/.env",paraId:8,tocIndex:5},{value:" file.",paraId:8,tocIndex:5},{value:"If an environment variable does not exist in a specific environment, please check whether the corresponding ",paraId:8,tocIndex:5},{value:"dotenv/{env}.env",paraId:8,tocIndex:5},{value:" file exists.",paraId:8,tocIndex:5},{value:"If the variables are determined only during compilation, you can additionally use ",paraId:8,tocIndex:5},{value:"DefinePlugin",paraId:8,tocIndex:5},{value:" for variable substitution, but these variables will not be compiled into dynamic environment variables.",paraId:8,tocIndex:5},{value:"When compiling, please make sure that the files under ",paraId:8,tocIndex:5},{value:"dotenv",paraId:8,tocIndex:5},{value:" have the definitions of all environment variables (subject to ",paraId:8,tocIndex:5},{value:"root/path/.env",paraId:8,tocIndex:5},{value:"). Even if the environment does not require the environment variables, you still need to declare the variables.",paraId:8,tocIndex:5},{value:"@dumlj/envs-switch-webpack-plugin",paraId:9},{value:`
